[[File:Lensa chathead.png|left]]
'''Lensa''' is one of the many named citizens of [[Rellekka]] and can be found near the entrance. At level 45 [[Thieving]] and after [[The Fremennik Trials]], this npc can be [[Thieving#Pickpocketing|pickpocketed]] for 40 [[coins]] and 65 [[Thieving]] experience.

A [[Smelly journal]] can be found in the ruined fishing hamlet to the east of the [[Wintertodt Camp]]. Written inside are the voyages of Larkur, presumably Lensa's lover or admirer as each entry starts with "Dearest Lensa."

